import { useEffect, useState } from "react";

const Lifecycle = () => {
  const [count, setcount] = useState(0);
  const [text, settext] = useState("");

  useEffect(() => {
    console.log("Mount!");
  }, []);
  return (
    <div style={{ padding: 20 }}>
      {count}
      <button
        onClick={() => {
          setcount(count + 1);
        }}
      >
        +
      </button>
      <button
        onClick={() => {
          setcount(count - 1);
        }}
      >
        -
      </button>
      <div>
        <input
          value={text}
          onChange={(e) => {
            settext(e.target.value);
          }}
        />
      </div>
    </div>
  );
};

export default Lifecycle;
